import { AppBar } from "@material-ui/core";
import { Box, Grid, Toolbar } from "@mui/material";

const Footer = () => {
  return (
    <>
      <Toolbar
        position="static"
        sx={{ width: "90%", m: "0 auto", borderBottom: "1px solid" }}
      >
        <Grid container>
          <Grid display="flex" justifyContent="center" alignContent="center">
            Hi
          </Grid>
        </Grid>
      </Toolbar>
      <Toolbar></Toolbar>
    </>
  );
};

export default Footer;
